import React from 'react';
import { 
  Card,
  CardContent,
  Typography,
  Grid,
  Container
} from '@mui/material';

const MatchList = ({ matches }) => {
  console.log('MatchList received matches:', matches);

  if (!matches || matches.length === 0) {
    return (
      <Container>
        <Typography>No matches available</Typography>
      </Container>
    );
  }

  return (
    <Container>
      <Grid container spacing={2}>
        {matches?.map((match, index) => {
          console.log('Rendering match:', match);
          return (
            <Grid item xs={12} md={6} key={index}>
              <Card>
                <CardContent>
                  {match.rapid_data && (
                    <>
                      <Typography variant="h6" gutterBottom>
                        {match.rapid_data.raw_event_data.team1} vs {match.rapid_data.raw_event_data.team2}
                      </Typography>
                      <Typography color="textSecondary">
                        Event ID: {match.rapid_data.raw_event_data.eventId}
                      </Typography>
                    </>
                  )}
                  {match.betsapi_data && (
                    <Typography color="textSecondary">
                      Bet365 ID: {match.betsapi_data.bet365_id}
                    </Typography>
                  )}
                </CardContent>
              </Card>
            </Grid>
          );
        })}
      </Grid>
    </Container>
  );
};

export default MatchList;
